window.bookSummaryJSON = "<p>Alexis Carter is a long way from home, and she doesn't quite understand how she got here. All she knows is that she died once, and now she's alive.</p> <p>She's woken into a nightmare, trapped on a dark ship full of terrifying aliens. With their silver skin and fire-colored eyes, they look a lot like the monsters that once attacked her on Earth.</p> <p>One Kordolian in particular stands out.... He's huge, he doesn't talk much, and his job is to guard her.</p> <p>From what, exactly?</p> <p>The voices inside her head?</p> <p><b>Contains mature themes.</b></p>"; 
